import React from "react";
import s from "./Paginator.module.css";

const Paginator = ({currentPage,onPageChanged,totalItemCount,pageSize, portionSize=10}) => {
  let pagesCount = Math.ceil(totalItemCount / pageSize);

  let pages = [];
  for (let i = 1; i <= pagesCount; i++) {
    pages.push(i);
  }

  let portionCount = Math.ceil(pagesCount/ portionSize)

  return (
    
      
      <div>
      <h1>Users</h1>
        {pages.map((p) => {
          return (
            <button
              className={
                currentPage === p ? s.selectedPageActive : s.selectedPage
              }
              onClick={(e) => {
                onPageChanged(p);
              }}
            >
              {p}
            </button>
          );
        })}
      </div>
    
  );
};

export default Paginator;
